				"intendToBid": 2,
				"submissionStatus": 3,
				"totalBidValue": 250000.00,
				"totalBudgetValue": 250000.00,
				"bidCoverLetter": "<p>While this approach&nbsp;<em>somewhat works</em>, the two are fundamentally different events that have different expectations in the eyes of the user. Using&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">onMouseDown</code>&nbsp;instead of&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">onClick</code>&nbsp;will ruin the predictability of your software in this case. Thus, the two events are noninterchangeable.</p><p>To illustrate: when accidentally clicking on a button, users expect to be able to hold down the mouse click, drag the cursor outside of the element, and release the mouse button, ultimately resulting in no action.&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">onClick</code>&nbsp;does this.&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">onMouseDown</code>&nbsp;doesn't allow the user to hold the mouse down, and instead will immediately trigger an action, without any recourse for the user.&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">onClick</code>&nbsp;is the standard by which we expect to trigger actions on a computer.</p>",
